import http from "./http-common";
import qs from 'qs';
//const querystring = require('querystring');
class DataService {
  create(dados) {
    return http.post("/simulado", qs.stringify(dados));
  }

  retrieve(){
    return http.get("/");
  }

}
export default new DataService();
